import { useState, useEffect } from 'react'
import { Auth, API, graphqlOperation } from 'aws-amplify'
import gql from 'graphql-tag'

const ListBranchesByAdminId = gql`
    query listBranchesByAdminId($adminId: ID!) {
        listBranchs(filter: { adminId: { eq: $adminId } }) {
            items {
                adminId
                branchName
                createdAt
                id
                updatedAt
            }
        }
    }
`

const Branch = () => {
    const [user, setUser] = useState(null)
    const [branches, setBranches] = useState(null)

    const checkUser = async () => {
        try {
            const user = await Auth.currentAuthenticatedUser()
            setUser(user)
            const fetchedBranches = await API.graphql(
                graphqlOperation(ListBranchesByAdminId, { adminId: user.attributes.sub })
            )
            setBranch(fetchedBranches)
        } catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        checkUser()
    }, [])

    return <div>Hi there Zaven jan</div>
}

export default Branch
